import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../../css/style.css'; // Pastikan sudah sesuai path ke file CSS utama

const DashboardAdmin = () => {
    const navigate = useNavigate();

    return (
        <div className="admin-container">
            <h2>Dashboard Admin</h2>
            <div className="admin-menu">
                <button onClick={() => navigate('/admin/manajemen-wisata')}>Manajemen Wisata</button>
                <button onClick={() => navigate('/admin/tambah-wisata')}>Tambah Wisata Baru</button>
                
                {/* Menu Lawa */}
                <button onClick={() => navigate('/admin/manajemen-lawa')}>Manajemen Lawa</button>
                <button onClick={() => navigate('/admin/tambah-lawa')}>Tambah Lawa Baru</button>
            </div>
        </div>
    );
};

export default DashboardAdmin;
